	add("boozer", "{\"term\":\"boozer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|booze|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who drinks habitually; a drunkard\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, w:Thomas Thomas Hardy, \u0027w:Tess of the Tess of the D\u0027Urbervilles, A Pure Woman, Faithfully Presented\u0027, 1963, %22boozers%22+-intitle:%22boozer|boozers%22+-inauthor:%22boozer|boozers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgnsCT4D5CeLTmAX4gZ2TBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22boozers%22%20-intitle%3A%22boozer|boozers%22%20-inauthor%3A%22boozer|boozers%22\u0026amp;f\u003dfalse page 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"“Tess is a fine figure o′ fun, as I said to myself today when I zeed her vamping round parish with the rest,” observed one of the elderly \u0027\u0027boozers\u0027\u0027 in an undertone\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Charles Stelzle, \u0027Why Prohibition!\u0027, 2008, %22boozers%22+-intitle:%22boozer|boozers%22+-inauthor:%22boozer|boozers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d9XYCT6f8J4L4mAXb3LysAg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22boozers%22%20-intitle%3A%22boozer|boozers%22%20-inauthor%3A%22boozer|boozers%22\u0026amp;f\u003dfalse page 49\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But they have only one insurance rate for ordinary men — drinkers and non-drinkers, and they compel the man who doesn′t booze to make up for the extra amount that the \u0027\u0027boozer\u0027\u0027 should pay\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 November, Neville Franks, \u0027The Lost Boy of the Ozarks\u0027, \u0027w:Backpacker Backpacker\u0027, %22boozers%22+-intitle:%22boozer|boozers%22+-inauthor:%22boozer|boozers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dMW8CT9nKMuznmAXOx8isAg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22boozers%22%20-intitle%3A%22boozer|boozers%22%20-inauthor%3A%22boozer|boozers%22\u0026amp;f\u003dfalse page 82\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Every swig made me more relaxed, and happy, and I was definitely a \u0027\u0027boozer\u0027\u0027 again, and I wondered why I had ever thought I wasn\u0027t a \u0027\u0027boozer\u0027\u0027 and I took another pull and I was going to clap BC on the back and thank him for being such a good hotel manager, and faithful guide, for being my friend, and then I passed out\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A public house\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A World War II fighter radar detector, fitted to British bombers\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A vehicle equipped with tanks for supplying water to remote locations\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 June 8, \u0027Kenya National Assembly Official Record (Hansard)\u0027, %22boozers%22+-intitle:%22boozer|boozers%22+-inauthor:%22boozer|boozers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d03ECT43hFKnwmAXP7_GNAg\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"%22boozers%22%20-intitle%3A%22boozer|boozers%22%20-inauthor%3A%22boozer|boozers%22\u0026amp;f\u003dfalse page 2\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Mr. Mututho: Mr. Speaker, Sir, the Assistant Minister should assure the people of Vihiga that they will get a water \u0027\u0027boozer\u0027\u0027 because the sick people are not party to this complication. Could he assure the people that he can send a \u0027\u0027boozer\u0027\u0027 in his capacity even if he cannot supply power or a standby generator, so that they can have a small well\", \"priority\":16}]}, \"synonyms\":{}}");

